import { Chess } from 'chess.js';


export const onDrop = (
    game: Chess,
    setFen: (fen: string) => void,
    sourceSquare: string,
    targetSquare: string,
): boolean => {
    const move = game.move({
        from: sourceSquare,
        to: targetSquare,
        promotion: 'q',
    });

    if (move) {
        setFen(game.fen());
        return true;
    }

    return false;
};
